import React from 'react';
import './styles/Contact.css';

function Contact() {
  return (
    <section className="contact">
      <h2>Contact</h2>
      <div className="contact-details">
        <p><strong>Phone:</strong> +123-456-7890</p>
        <p><strong>Email:</strong> your.email@example.com</p>
        <p><strong>Address:</strong> 123 Your Street, Your City, Your Country</p>
      </div>
      <div className="social-media">
        <h3>Connect with me:</h3>
        <ul>
          <li><a href="https://linkedin.com/in/yourprofile" target="_blank" rel="noopener noreferrer">LinkedIn</a></li>
          <li><a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer">GitHub</a></li>
          <li><a href="https://twitter.com/yourusername" target="_blank" rel="noopener noreferrer">Twitter</a></li>
          <li><a href="https://facebook.com/yourusername" target="_blank" rel="noopener noreferrer">Facebook</a></li>
        </ul>
      </div>
    </section>
  );
}

export default Contact;
